/* Alguns exemplos de SQL são fornecidos com base em problemas similares: */
/* Responda o seguinte: Verifique a quantidade de eventos ocorridos em cada caso até que ele tenha alcançado a execução da atividade 'fim da viagem'. */
select count(*), e1.idcase from event_log AS e1 inner join event_log AS e2 on e1.idcase = e2.idcase WHERE e2.activity = 'Fim da viagem' and e1.timestamp < e2.timestamp group by e1.idcase

/* Responda o seguinte: Quantos eventos ocorreram em cada caso até que ele tenha passado pela atividade 'fim da viagem'? */
select count(*), e1.idcase from event_log AS e1 inner join event_log AS e2 on e1.idcase = e2.idcase WHERE e2.activity = 'Fim da viagem' and e1.timestamp < e2.timestamp group by e1.idcase

/* Responda o seguinte: Liste os eventos dos casos, assim como o responsável pela atividade executada no evento, que tenham ocorrido depois de um evento de execução da atividade 'fim da viagem'.  */
select e1.activity, e1.resource, e1.idcase from event_log AS e1 inner join event_log AS e2 on e1.idcase = e2.idcase  WHERE e2.activity = 'Fim da viagem' and e1.timestamp > e2.timestamp

/* Responda o seguinte: Informe o custo médio dos eventos associados a atividades diferentes de 'início da viagem' e 'fim da viagem'? */
SELECT AVG(cost) FROM event_log WHERE activity != 'Início da viagem' AND activity != 'Fim da viagem'

/* Responda o seguinte: Liste os eventos, assim como o responsável pela atividade executada no evento, que tenham ocorrido depois de um evento de execução da atividade 'fim da viagem' no mesmo caso.  */
